import { Routes,Route } from "react-router-dom";
import { Loginpage, ForgotPage, SignupPage  } from "../../pages/authentication";
import { LandingPage, Cart, Wishlist, ProductWithFilter,ErrorPage ,SingleProductPage} from "../../pages";
import { PrivateRoute } from "../private-routes/private-route";
export const  PublicRoute=()=>{
    return (
        <Routes>
        <Route path="/login" element={<Loginpage />} />
        <Route path="/signup" element={<SignupPage />} />
        <Route path="/forgot-password" element={<ForgotPage />} />
        <Route path="/" element={<LandingPage />} />
        <Route path="/products" element={<ProductWithFilter />} />
        <Route path="*"element={<ErrorPage/>}/>
        <Route path="/products/pr" element={<SingleProductPage/>}/>
        <Routes
        path="/wishlist" 
        element={
            <PrivateRoute>
                <Wishlist />
            </PrivateRoute>
        } />
        <Route 
        path="/cart" 
        element={
            <PrivateRoute>
                <Cart />
            </PrivateRoute>
        } />
      </Routes>
    )
}
